        const optionsContainer = document.getElementById(optionsId);
        toggle.addEventListener('click', (e) => { e.stopPropagation(); document.querySelectorAll('.custom-dropdown-wrapper.active').forEach(dw => { if (dw !== wrapper) dw.classList.remove('active'); }); wrapper.classList.toggle('active'); });
        optionsContainer.addEventListener('click', (e) => { if (e.target.classList.contains('custom-dropdown-option')) { const value = e.target.dataset.value; const text = e.target.textContent; stateCallback(value, text); textElement.textContent = text; optionsContainer.querySelector('.selected')?.classList.remove('selected'); e.target.classList.add('selected'); wrapper.classList.remove('active'); } });
